def iter_errors(self, instance, _schema=None):
    if _schema is not None:
        warnings.warn(
            (
                "Passing a schema to Validator.iter_errors "
                "is deprecated and will be removed in a future "
                "release. Call validator.evolve(schema=new_schema)."
                "iter_errors(...) instead."
            ),
            DeprecationWarning,
            stacklevel=2,
        )
        validators = [
            (self.VALIDATORS[k], k, v)
            for k, v in applicable_validators(_schema)
            if k in self.VALIDATORS
        ]
    else:
        _schema, validators = self.schema, self._validators

    if _schema is True:
        return
    elif _schema is False:
        yield exceptions.ValidationError(
            f"False schema does not allow {instance!r}",
            validator=None,
            validator_value=None,
            instance=instance,
            schema=_schema,
        )
        return

    for validator, k, v in validators:
        errors = validator(self, v, instance, _schema) or ()
        for error in errors:
            # set details if not already set by the called fn
            error._set(
                validator=k,
                validator_value=v,
                instance=instance,
                schema=_schema,
                type_checker=self.TYPE_CHECKER,
            )
            if k not in {"if", "$ref"}:
                error.schema_path.appendleft(k)
            yield error

